import React from "react";
import Gif from "./GIF";


export default function ListGifs({gifs}){



   return gifs.map(({id, title, url})=>
    {return (
      <Gif
      key={id}
       id={id} 
       url={url} 
      title={title} 

        />
     ) })



}
